import React from 'react';
//import gapi from 'gapi-client';
import './App.css';

function App() {

  fetch("https://www.reddit.com/api/v1/authorize?client_id=BmIWdmE0hYrM7Q&response_type=code&state=alskdjfhg&redirect_uri=http://localhost:3000&duration=permanent&scope=read&raw_json=1",
  {
    method: 'GET',
    mode: 'no-cors',
    redirect: 'follow',
  })
  .then((response) => {
    console.log(response.json());
  }).then((json) => {
    console.log(json);
  })
  .catch(function(err) {
    console.info(err + " url: ");
  });

  return (
    <div className="App">
    </div>
  );
}

export default App;
